  description:
    '<span style="color:#000000;"><span style="font-size:16px;"></span><span style="font-size:20px;"><strong>DETAILS:</strong></span><span style="font-size:16px;"><br>\n<br>\nWire: PALIC<br>\n<br>\nMaterial: 6N single crystal copper OCC<br>\n<br>\nLength: 1 meter<br>\n<br>\nPlug-in: MMCX plug - high-end custom beryllium copper one without ferrule plating ternary alloy; 3.5 plug - carbon fiber chrome plating<br>\n<br>\nFeatures:The cable is relatively soft, suitable for computers with mobile phones, tablets, or mobile phones, tablet connection decoders.<br>\n<br>\n<br>\n<strong>There are 2 models for A to A, which are different plug sizes. The small plug is more suitable for laptops connected to the decoder.</strong></span></span><br>\n \n<p style="text-align: left;margin:0;"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822155727/4915b1895aec9421fc35298914279b9c.jpg"></p>\n<span style="color:#000000;"><span style="font-size:16px;"><strong><br>\n<img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822155727/9622e7231f6cb2c28883d8b15b5d2cea.jpg"><br>\n<br>\n<br>\n<br>\nA to A (B, Type-C, microUSB) <br>\n<br>\nA to A (B, Type-C, microUSB) can realize USB audio transmission between PC and decoder. Compared with random data lines, it has</strong></span></span><span style="color:#000000;"><span style="font-size:16px;"><strong> better performance in terms of resolution, layering and detail.</strong></span></span><br>\n \n<p style="text-align: left;margin:0;"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162243/a18bc9ae0855f4b61b2b6dac87952dfd.jpg"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162311/05f326d4c112589a9d722058050f5621.jpg"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162311/8d3e91d0acc838c04ca1f99fbd14d064.jpg"></p>\n<span style="color:#000000;"><span style="font-size:16px;"><strong><br>\n<br>\n<br>\nOTG Type-C to A (B, C, mciroUSB) <br>\n<br>\nOTG Type-C to A (B, C, mciroUSB) can realize USB audio transmission between mobile phone, tablet and decoder of TYPE-C interface, compared with random data lines, in resolution, layering, detail, etc. There is better performance in terms of aspects.</strong></span></span><br>\n \n<p style="text-align: left;margin:0;"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162425/1b3994836b6eb7ea48c5af76e54a68f0.jpg"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162425/28a5e769d800743cc3e732cf38f96815.jpg"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162425/f9d52b349ecf61b9dc476925228b8aab.jpg"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162425/dc939def23522186225f4cf94d94b19d.jpg"></p>\n<span style="color:#000000;"><span style="font-size:16px;"><strong></strong></span></span>\n\n<p class="detail-desc-decorate-title" style="box-sizing: border-box; margin: 0px 0px 12px; font-size: 20px; line-height: 28px; font-weight: 900; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; text-overflow: ellipsis; font-family: OpenSans; overflow-wrap: break-word; white-space: pre-wrap;"><br>\n<br>\n<br>\nOTG micro USB to A (B, type-C, microUSB)</p>\n\n<p class="detail-desc-decorate-content" data-spm-anchor-id="a2g0o.detail.1000023.i4.24086c80a7QFWp" style="box-sizing: border-box; margin: 0px 0px 12px; font-size: 14px; line-height: 20px; font-weight: 300; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; text-overflow: ellipsis; font-family: OpenSans; overflow-wrap: break-word; white-space: pre-wrap;"><strong>OTG micro USB to A (B, type-C, microUSB) enables USB audio transmission between the phone, tablet and decoder of the micro interface. Compared with random data lines, it has better performance in terms of resolution, layering, and detail.<br>\n<br>\n<img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162604/5553e45cadcb258dbcfd21f662d7c487.jpg"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162604/8506ccbcf85ecc382e1501c4588a161e.jpg"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162604/19a8c6c5705d39269c3f33cd65c88ef5.jpg"><img src="https://wxalbum-10001658.image.myqcloud.com/wxalbum/263033/20190822162603/82a6ed2eef35641b8bc24056469e24e2.jpg"></strong></p>\n<strong> </strong><span style="color:#000000;"> <span style="font-size:16px;"><strong></strong></span></span><br>\n ',
